import all from 'everyday-fun';

const getQuote = () => {
  let quote = all.getRandomQuote().quote;
  return (
    <p>
      {quote}
    </p>
  )
}

function App() {
  return (
    <div className="bg-gradient-to-br from-slate-900 to-wetAsphalt text-slate-100 text-center">
      <header className="App-header">
        <h3>Inspirational Quotes</h3>
      </header>
      <getQuote />
    </div>
  );
}

export default App;
